(1, '<center><B>SIMON H, WE CAN EDIT ALL THIS TEXT TO APPEAR HOW YOU WANT </B> <br />\r\n<h3 style="color:red">IMPORTANT PLEASE READ</h3> <br />\r\n<b>Quote Database:</b> Please note this database is a collection of previous quotes obtained <br />\r\nfrom external printers. <b>These costs exclude GST, and should only be used as a guide.</b>   <br />\r\n<br />\r\nThe purpose of this database is for a quick reference cost guide <br />\r\nand a genuine quote must be obtained if your client shows interest.<br />\r\n<br />\r\nThe majority of costs in this database are based on paper stock purchased overseas <br />\r\n12-14 weeks ordering time is required using these stocks<br />\r\n<br />\r\n<br />\r\n<i>Any quotes prior to July 2009 please add 10-15% due to paper stock increases.</i><br />\r\n<br />\r\nFor any assistance with this database or for a more up-to-date quote please call <br />\r\n<br />\r\n 9288 2298<br />\r\n<br />\r\nThe commercial print quote request form and procedures can be found on the intranet at the below link<br />\r\n<br />\r\n<a href="http://intranet2.c3p.newsltd.com.au/NewsIT/MastHeads/Paperwork/Forms/" style="text-decoration:underline;" target="blank">http://intranet2.c3p.newsltd.com.au/NewsIT/MastHeads/Paperwork/Forms/</a><br />\r\n<br />\r\n<b>Message from Ad Director:</b>  All quotes are a guide to production only cost, they do not include any additional costs that may be associated with producing the publication and they do not include any profit margin.<br />\r\nThese quotes are for internal use only and must not be communicated to clients.<br />\r\nPrior to calculating the total cost of any publication or communicating any price to your client you must consult with your manager to have the price approved.<br />\r\n'),
(2, 'sss'),
(3, 'sss<br />\r\n<br />\r\nxx'),
(4, 'sssss'),
(5, 'This is some text'),
